import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category to get to product listing page
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for products to load
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Find and click the list view button
    await page.waitForSelector('.view-toggle button[title="List View"]', { timeout: 5000 });
    await page.click('.view-toggle button[title="List View"]');

    // Wait for list view to activate
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify list view is active
    const isListViewActive = await page.$eval('.view-toggle button[title="List View"]', 
      button => button.classList.contains('active'));

    const productsInListView = await page.$$eval('.products-list .product-card-list', 
      products => products.length);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        isListViewActive,
        productsCount: productsInListView
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
